import './App.css';
import { useState, useEffect } from 'react'
import Home from './Components/Home';

function App() {
  const [data, setData] = useState({username:'', role:''});

  useEffect(() => {
    fetch("/studentLogin")
      .then((res) => res.json())
      .then((data) => {setData({username: data.username, password: data.password, role: data.role})});
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        {/* <p>UserName: {!data ? "Loading..." : data.username}</p>
        <p>Password: {!data ? "Loading..." : data.password}</p> */}

        <Home />

        {/* {console.log(home)} */}
      </header>
    </div>
  );
}

export default App;
